import {ReactComponent as Logoi} from "../images/logo/logoBrand.png";

export const Logo = (props) => {
   const logoo = "logoBrand.png";
    return (
        <div className="logo">
           <img src={logoo} alt="logo" title="logo"/>      
         </div>
    );
};
